                <div className="row">
                    <div className="col-lg-12">
                        <p className="text-white">@ 1950-2022 Creative Multimedia$| All Rights Reserved</p>
                    </div>
                </div>
            </div>
           </div>
        </>
    
    )
    
}
export default Footer;
